import React from "react";


const Header = () => {
  
  return (
    <div className="ui fixed menu">
      <div className="ui container center">
        <h2>React ContextApi</h2>
        <div className="profile">
          <h3>Welcome, </h3>
         
            <button className="ui button blue" >
              LogOut
            </button>
          )}
        </div>
      </div>
    </div>
  );
};

export default Header;
